import React from "react";
import { createStackNavigator } from '@react-navigation/stack';
import Smart from "../screens/Smart"


const Stack = createStackNavigator();

export default function SmartStack(){
    return(
        <Stack.Navigator>
            <Stack.Screen 
                name="noticias"
                component={Smart}
                options={{
                    title:'Noticias',
                    headerTitleAlign: 'center'}}
            />
        </Stack.Navigator>
    )
}
